query IndexQuery {
  hero: allMarkdownRemark(filter: {fileAbsolutePath: {regex: "/hero/"}}) {
    edges {
      node {
        frontmatter {
          title
          name
          subtitle
          contactText
        }
        html
      }
    }
  }
  about: allMarkdownRemark(filter: {fileAbsolutePath: {regex: "/about/"}}) {
    edges {
      node {
        frontmatter {
          title
          avatar {
            childImageSharp {
              fluid(maxWidth: 700, quality: 90, traceSVG: {color: "#64ffda"}) {
                ...GatsbyImageSharpFluid_withWebp_tracedSVG
              }
            }
          }
          skills
        }
        html
      }
    }
  }
  jobs: allMarkdownRemark(filter: {fileAbsolutePath: {regex: "/jobs/"}}, sort: {fields: [frontmatter___date], order: DESC}) {
    edges {
      node {
        frontmatter {
          title
          company
          location
          range
          url
        }
        html
      }
    }
  }
  featured: allMarkdownRemark(filter: {fileAbsolutePath: {regex: "/featured/"}}, sort: {fields: [frontmatter___date], order: DESC}) {
    edges {
      node {
        frontmatter {
          title
          cover {
            childImageSharp {
              fluid(maxWidth: 700, quality: 90, traceSVG: {color: "#64ffda"}) {
                ...GatsbyImageSharpFluid_withWebp_tracedSVG
              }
            }
          }
          tech
          github
          external
        }
        html
      }
    }
  }
  projects: allMarkdownRemark(filter: {fileAbsolutePath: {regex: "/projects/"}}, sort: {fields: [frontmatter___date], order: DESC}) {
    edges {
      node {
        frontmatter {
          title
          image
          tech
          github
          external
          show
        }
        html
      }
    }
  }
  contact: allMarkdownRemark(filter: {fileAbsolutePath: {regex: "/contact/"}}) {
    edges {
      node {
        frontmatter {
          title
        }
        html
      }
    }
  }
}

fragment GatsbyImageSharpFluid_withWebp_tracedSVG on ImageSharpFluid {
  tracedSVG
  aspectRatio
  src
  srcSet
  srcWebp
  srcSetWebp
  sizes
}

